import React from 'react';
import { Item, Button, Segment, Icon, Label } from 'semantic-ui-react';
import { Link } from 'react-router-dom';
import { format } from 'date-fns';

import { IAffilie } from '../../../app/models/affilie';

const AffilieListItem: React.FC<{ affilie: IAffilie }> = ({ affilie }) => {
  //const host = affilie.attendees.filter(x => x.isHost)[0];
  return (
    <Segment.Group>
      <Segment>
        <Item.Group>
          <Item>

            <Item.Content>
              <Item.Header as={Link} to={`/affilies/${affilie.Cin}`}>
                {affilie.Nom}
              </Item.Header>
              <Item.Description>
                Hosted by
                <Link to={`/profile/${affilie.Prenom}`}> {affilie.Nom}</Link>
              </Item.Description>

            </Item.Content>
          </Item>
        </Item.Group>
      </Segment>

    </Segment.Group>
  );
};

export default AffilieListItem;
